import React, { Component } from 'react';
import Nbar from './Nbar.js';



class App extends Component {

  constructor(props){
    super(props)
    this.state = {
      contract:'',
    }    
  }

  render() {
    const imgStyle ={
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center'
    };
    return (
      <div className="Home">
        <Nbar/>
        <br/>
        <br/>
        <div style={imgStyle}>
          <img src={require('../images/org.png')} height = '100px' weight = '100px'/>
          <img src={require('../images/joinIcon.png')}/>
          <img src={require('../images/org.png')}/>
        </div>
      </div>
    );
  }
}

export default App;
